import React, { useState } from 'react';
import './styles.css';
import Spreadsheet from './components/Spreadsheet.js';
import InputForm from './components/InputForm.js';
import axios from 'axios';

import EditableTable from './components/EditableTable.js';

const App = () => {
  const initialData = [['John', 'Doe', 30], ['Jane', 'Smith', 25]];
  const columns = ['First Name', 'Last Name', 'Age'];
  const nameOptions = ['John', 'Jane', 'Alice', 'Bob'];
  const lastNameOptions = ['Doe', 'Smith', 'Johnson', 'Brown'];
  const pitchTypes = [
    '4S Fastball',
    '2S Fastball',
    'SI Fastball',
    'CT Fastball',
    'Cutter',
    'Gyro Slider',
    'Slider',
    'Slutter',
    'Sweeper',
    'Slurve',
    '12/6',
    'Traditional CH',
    'Sidespin SH',
    'Splitter'
  ];
  const handTypes = ['RH', 'LH'];

  return (
    <div>
      <EditableTable data={initialData} columns={columns} options={[pitchTypes, handTypes]} />
    </div>
  );
};

export default App;
